import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const aa = styled.div`
  justify-content: center;
`;

export const Header = () => {
  return (
    <div>
      <h1>Coin Info</h1>
      <aa>
        {" "}
        <Link to="/">Coins</Link>
      </aa>
      <Link to="/exchanges">Exchanges</Link>
      <Link to="/prices">Prices</Link>
    </div>
  );
};
